import './App.css';
import React, { Component } from 'react';
import Index from './Components';
import Login from './Components/Login';
import Admin from './Components/Admin';
import Home from './Components/Home';
import RegisterForm from './Components/RegisterForm';

import { Routes, Route } from 'react-router';
import Customer from './Components/Customer/Customer';
import OrderDetail from './Components/OrderDetail/OrderDetail';
import Order from './Components/Order/Order';
import Product from './Components/Product/Product';
import Category from './Components/Category/Category';
import Employee from './Components/Employee/Employee';
import Admin1 from './Components/Customer/Admin';
import Guess from './Components/Guess/Guess';
import AccountSetting from './Components/AccountSetting';

class App extends Component {
  constructor(pros){
    super(pros)

    this.state = {
      "target": ""
    }
  }
  render(){

    <Routes>
        <Route path="/Categories" element={<Category/>}></Route>
        <Route path="/Products" element={<Product/>}></Route>
        <Route path="/Orders" element={<Order/>}></Route>
        <Route path="/Reports" element={<OrderDetail/>}></Route>
        <Route path="/Customers" element={<Customer/>}></Route>
        <Route path="/Employees" element={<Employee/>}></Route>
        <Route path="/Admins" element={<Admin1/>}></Route>
        <Route path="/Guess" element={<Guess/>}></Route>
        <Route path="/Login" element={<Login/>}></Route>
        <Route path="/RegisterForm" element={<RegisterForm/>}></Route>
        <Route path="/AccountSetting" element={<AccountSetting/>}></Route>
    </Routes>
    if(localStorage.getItem("Token")){
      if(localStorage.getItem("Role") === "Nhân Viên"){
        return (
          <Index/>
        );
      }
      else if(localStorage.getItem("Role") === "Khách hàng"){
        return (
          <Home/>
        );
      }
      else{
        return(
        <Admin/>
        );
      }
    }
    else{
      return(
          <Login/>
      );
    }
  }
}

export default App;
